import React from 'react'

const Login = (props) => {
    const{
        email,
        setEmail,
        password, 
        setPassword,
        emailError,
        setEmailError,
        passwordError,
        setPasswordError,
        hasAccount, 
        setHasAccount
    } = props;

    return (
        <section className="login">
            <div className="login_Container">
                <label>Username</label> 
                <input 
                type="text"
                autoFocus
                required
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                />
                <p class>{emailError}</p>
            </div>
        </section>
    )
}

export default Login;
